(13, 'tmZZU6', 178, 'Test Production', '2023-03-03.jpg', '<p>Riyasat Infra Developers Private Limited is a Company registered under Companies Act, 2013 which is recently incorporated on 26.04.2021 by promoter of the Company.</p>\r\n\r\n<p>&nbsp;</p>', 1, '2023-06-30 06:24:12', '2023-06-30 14:49:20'),
(14, 'X4mpdB', 179, 'Stpl Production', 'download (7).jpg', '<p>Riyasat Infra Developers Private Limited is a Company registered under Companies Act, 2013 which is recently incorporated on 26.04.2021 by promoter of the Company i.e., Mr. Sumer Singh Saini.</p>\r\n\r\n<p>As our tagline says &ldquo;A Sign of Trust&rdquo;, we strive to create an environment of trust and faith between our sales associates and customers and we strongly believes that we play a vital role in shaping the land of our great nation through following its core values of delivering quality and excellent real estate spaces ensuring customer satisfaction.</p>\r\n\r\n<p>We see ourselves not as builder of homes but as a builder of happy communities. We measure success not by the numbers in our balance sheet but by the width of your smile. We aim at providing services of developed residential townships which results in gaining full satisfaction of our clients. We are also committed towards developing ecologically sustainable projects, with a strong emphasis on environmental management and safety standards.</p>', 1, '2023-06-30 06:26:11', '2023-06-30 12:03:46'),
